// import specific style here
import skillgraphicStyles from './styles/skillgraphic.module.scss';

// import relevant components
import Specialties from './skills/Specialties'
import cx from 'classnames'

const pStyle = {
    fontSize: '15px',
    textAlign: 'center'
};

const SkillGraphics = () => {
    return (
        <div className={skillgraphicStyles.graphicsContainer}>
            <Specialties />
            <div className={skillgraphicStyles.skillBar}>
                <div className={skillgraphicStyles.skill}>Python</div>
                <div className={cx(skillgraphicStyles.stats)} style={{ width: '50%' }}></div>
            </div>
        </div>
    )
}

export default SkillGraphics;
